import React from "react";

const languageMap = {
  en: "English", hi: "Hindi", pa: "Punjabi", mr: "Marathi", gu: "Gujarati",
  bn: "Bengali", ta: "Tamil", te: "Telugu", kn: "Kannada", ml: "Malayalam",
  or: "Odia", as: "Assamese", ur: "Urdu", sd: "Sindhi", sa: "Sanskrit",
  ks: "Kashmiri", kok: "Konkani", mai: "Maithili", ne: "Nepali",
};

const allLangCodes = Object.keys(languageMap);

const Header = ({ langData, currentLang, onLangChange, onNavigate, currentPage }) => {

  const handleNavClick = (e, page) => {
    e.preventDefault();
    onNavigate(page);
  };

  // ðŸ”¹ Active + Hover visual feedback
  const navItemClass = (page) =>
    `relative px-2 py-1 font-medium transition-all duration-300
     ${currentPage === page
        ? "text-green-600 after:absolute after:left-0 after:-bottom-1 after:w-full after:h-[2px] after:bg-green-600"
        : "text-gray-700 hover:text-green-600 after:absolute after:left-0 after:-bottom-1 after:w-0 after:h-[2px] after:bg-green-600 hover:after:w-full after:transition-all after:duration-300"
     }`;

  return (
    <header className="bg-white shadow-md sticky top-0 z-20 w-full">
      <nav className="flex justify-between items-center max-w-7xl mx-auto px-4 lg:px-8 py-4">

        {/* ðŸ”¹ LOGO (Bigger + Rounded + Inside items) */}
        <div
          onClick={(e) => handleNavClick(e, "home")}
          className="flex items-center gap-3 cursor-pointer bg-green-50 px-4 py-2 rounded-full hover:bg-green-100 transition"
        >
          <div className="bg-green-600 text-white rounded-full w-11 h-11 flex items-center justify-center">
            <i className="fa-solid fa-leaf text-xl"></i>
          </div>
          <h1 className="font-poppins text-xl font-semibold text-green-700">
            KrishiSakhi
          </h1>
        </div>

        {/* ðŸ”¹ NAV LINKS */}
        <ul className="hidden lg:flex items-center gap-8">
          <li>
            <button onClick={(e) => handleNavClick(e, "home")} className={navItemClass("home")}>
              {langData.home}
            </button>
          </li>
          <li>
            <button onClick={(e) => handleNavClick(e, "my-farm")} className={navItemClass("my-farm")}>
              {langData.myFarm}
            </button>
          </li>
          <li>
            <button onClick={(e) => handleNavClick(e, "todo")} className={navItemClass("todo")}>
              {langData.todo}
            </button>
          </li>
          <li>
            <button onClick={(e) => handleNavClick(e, "trend")} className={navItemClass("trend")}>
              {langData.trend}
            </button>
          </li>
          <li>
            <button onClick={(e) => handleNavClick(e, "feedback")} className={navItemClass("feedback")}>
              {langData.feedback}
            </button>
          </li>
        </ul>

        {/* ðŸ”¹ RIGHT SIDE */}
        <div className="flex items-center gap-4">

          {/* SEARCH */}
          <div className="relative hidden sm:block">
            <input
              type="text"
              placeholder={langData.search}
              className="border border-gray-300 rounded-full pl-4 pr-10 py-2 text-sm focus:outline-none focus:border-green-600 w-44"
            />
            <i className="fa-solid fa-magnifying-glass absolute right-3 top-1/2 -translate-y-1/2 text-gray-500"></i>
          </div>

          {/* LANGUAGE SELECT */}
          <select
            className="border border-gray-300 rounded-lg p-2 text-sm focus:outline-none focus:border-green-600"
            value={currentLang}
            onChange={(e) => onLangChange(e.target.value)}
          >
            {allLangCodes.map((lang) => (
              <option key={lang} value={lang}>
                {languageMap[lang]}
              </option>
            ))}
          </select>

          {/* ACCESSIBILITY */}
          <button
            aria-label="Accessibility"
            className="text-gray-700 hover:text-green-600 transition"
          >
            <i className="fa-solid fa-universal-access text-xl"></i>
          </button>
        </div>
      </nav>
    </header>
  );
};

export default Header;
